You all know that doing right by our earth and our oceans is a huge passion for me. At @mananalu.water , we choose aluminum because it’s infinitely recyclable – and that means it’s the best choice for our planet. I teamed up with our partners at @ballaluminumcup to bring you this new spot and show you how a cup really can make a big difference when it comes to eliminating single-use packaging. I hope you all enjoy it. Party responsibly and recycle! 

Mahalo to @da_bray for Directing his first National Commercial and our whole team who made this happen. 

